    false,nt"url": null,nt"notes": "This narrative report for Kenai NWR outlines
    Refuge accomplishments from September through December of 1955. The report begins
    by summarizing the weather conditions during this period. Wildlife- including migratory
    birds, big game animals, and mammals- is also covered. The Refuge development and
    maintenance section discusses physical developments. Resource management is outlined;
    topics include fur harvesting and timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses and Refuge visitors. Items of interest are attached.",nt"license_title":
